INSERT INTO `products` VALUES (10, 'Sufi Art Tray', 'sufi-art-tray', NULL, '<main id=\"MainContent\" class=\"content-for-layout focus-none\" role=\"main\" tabindex=\"-1\">\n<section id=\"shopify-section-template--24024098373947__main\" class=\"shopify-section section\">\n<section class=\"product-popup\">\n<div class=\"product-popup-wrap\">\n<div class=\"box-keyfeatures showfirst\">\n<div class=\"mpi-about-product-box\">\n<h5>Key Features</h5>\n<ul>\n<li class=\"first\">Size: 6.5x13 inches</li>\n<li>Material: Bernatiq or Natural Wood</li>\n<li>Whirling Dervishes Motif: The centerpiece of this tray features a mesmerizing depiction of whirling dervishes—an iconic symbol of Sufi mysticism. The intricate details capture the fluidity and grace of the mystical dance, symbolizing spiritual ascent.</li>\n<li>Rich and Lively Color Palette: Sufi art is known for its brilliant use of colors, and this tray is no exception. The rich and lively color palette reflects the vibrancy of Sufi traditions, creating a feast for the eyes and invoking a sense of joy and spirituality.</li>\n<li>Sufi Calligraphy Elegance: Surrounding the central motif, delicate Sufi calligraphy is artfully incorporated. The elegant script conveys profound messages of love, unity, and devotion, adding layers of meaning to the overall design.</li>\n<li class=\"last\">Handcrafted Artisanal Design: Each tray is a testament to the skill and artistry of master craftsmen. Meticulously handcrafted, the Sufi Colorful Art Design Tray reflects the dedication to preserving traditional techniques and creating a piece of functional art.</li>\n</ul>\n</div>\n</div>\n</div>\n</section>\n</section>\n<section id=\"shopify-section-template--24024098373947__1707733094f9ded1c0\" class=\"shopify-section section\">\n<div class=\"page-width\"><br></div>\n</section>\n</main>\n<div id=\"shopify-section-footer\" class=\"shopify-section\">\n<section class=\"why-powerhouse\">\n<ul class=\"wph-list\">\n<li class=\"first\">\n<div class=\"w