INSERT INTO `products` VALUES (135, 'K-202Portable Gas Stove BBQ-011', 'k-202portable-gas-stove-bbq-011', NULL, '<h1 class=\"a-size-large a-spacing-none\"><span class=\"a-size-large product-title-word-break\">K-202 Portable Gas Stove for Camping Hiking Picnic Mini Butane Burner Folding Furnace Outdoor with Storage Bag <br></span></h1>\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">COMPACT AND CONVENIENT: The HACER K-202 Portable Gas Stove is your go-to solution for all your outdoor cooking needs. Designed for camping, hiking, picnics, and more, it\'s a compact and lightweight mini butane burner that easily fits into your backpack. Its foldable design makes it incredibly convenient for any outdoor adventure.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">POWERFUL YET PRECISE: Despite its small size, this portable stove doesn\'t compromise on power. It delivers a consistent and adjustable flame, allowing you to cook with precision. Whether you need a gentle simmer or a roaring boil, the Gas Stove has you covered.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">SAFE AND RELIABLE: Safety is paramount in outdoor cooking equipment. The  Portable Gas Stove is equipped with multiple safety features, including a built-in pressure sensor and a safety shut-off valve. These ensure that the stove operates reliably and only when it\'s securely connected, giving you peace of mind during your outdoor activities.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">ALL-IN-ONE PACKAGE: This package includes a storage bag, making transportation and storage a breeze. No need to worry about carrying extra accessories or searching for a suitable bag. The HACER Gas Stove is a complete outdoor cooking solution in one compact package.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">DURABLE AND LONG-LASTING: Crafted from top-notch quality materials, the HACER Portable Gas Stove is built to withstand the rigors of outdoor use. It\'s easy to clean and maintain, ensuring it remains a reliable companion on your outdoor adventures for years to come.</span></li>\n</ul>\n<h1 class=\"a-size-large a-spacing-none\"><span id=\"productTitle\" class=\"a-size-large product-title-word-break\"><br></span></h1>', NULL, 'BBQ-011', 0, 0, 0, 2200.00, NULL, 1, 1, 1, 10, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:08', '2025-05-20 21:13:08', NULL);
INSERT INTO `products` VALUES (136, '65cm Fish Griller Iron BBQ-010', '65cm-fish-griller-iron-bbq-010', NULL, '<div id=\"featurebullets_feature_div\" class=\"celwidget\" data-feature-name=\"featurebullets\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"featurebullets\" data-csa-c-slot-id=\"featurebullets_feature_div\" data-csa-c-asin=\"B09Q68Z962\" data-csa-c-is-in-initial-active-row=\"false\" data-csa-c-id=\"7vv338-2l2gmt-cbyaa7-2o7nag\" data-cel-widget=\"featurebullets_feature_div\">\n<div id=\"feature-bullets\" class=\"a-section a-spacing-medium a-spacing-top-small\">\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">BBQ FISH GRILL WITH WOODEN HANDLE: Fish shaped BBQ fish grill with a wooden handle gives you a wonderful fish and vegetables grilling experience and the durable wooden handle prevents you from burning your hand.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">STRONGHOLD: Its thick gauge stainless steel bars, lid, and easy-to-use locking mechanism keep food firmly in place without the worry of breaking apart the flesh and allow for quick flipping and turning of food.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">PREMIUM QUALITY: Made from high-quality stainless steel and chrome plated. It\'s durable, able to withstand high temperatures and won’t rust.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">EASY TO CLEAN: The stainless steel bars are easy to clean no need to worry about food residue.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">PORTABLE TOOL: It is a portable tool for beachside and outdoor parties. You can grill fish or vegetables wherever you want to.</span></li>\n</ul>\n</div>\n</div>\n<div id=\"provenanceCertifications_feature_div\" class=\"celwidget\" data-feature-name=\"provenanceCertifications\" data-csa-c-type=\"widget\" data-csa-c-content-id=\"provenanceCertifications\" dat