INSERT INTO `products` VALUES (199, 'Arizona H-7 Glass Top Hotpot (Green) HAPPY HOUSE', 'arizona-h-7-glass-top-hotpot-green-happy-house', NULL, '<p><span>Introducing our Arizona H-7 (Green)</span><br><br><span>Choose from a variety of exquisite options to enhance your everyday meals and gatherings. Whether you\'re looking for the perfect gift set or standalone pieces to keep your food and beverages at the ideal temperature, Arizona H-7 has you covered.</span><br><br><span>Variations:</span><br><br><strong>5 Pcs Gift Pack Glass Top</strong><span>: This comprehensive set includes a cooler and a range of hotpots in small, medium, and large sizes, along with a reliable thermos to keep your beverages just the way you like them.</span></p>', NULL, 'arizona-h-7-glass-top-hotpot-green-happy-house-W98CT', 0, 0, 0, 9600.00, 11500.00, 1, 1, 1, 10, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:09', '2025-05-20 21:13:09', NULL);
INSERT INTO `products` VALUES (200, 'Happy Arizona H7 GRAY ( Glass Top 5 Pcs Set ) HAPPY HOUSE', 'happy-arizona-h7-gray-glass-top-5-pcs-set-happy-house', NULL, '<p><span>Introducing our Arizona H-7 (Grey)</span><br><br><span>Choose from a variety of exquisite options to enhance your everyday meals and gatherings. Whether you\'re looking for the perfect gift set or standalone pieces to keep your food and beverages at the ideal temperature, Arizona H-7 has you covered.</span><br><br><span>Variations:</span><br><br><strong>5 Pcs Gift Pack Glass Top</strong><span>: This comprehensive set includes a cooler and a range of hotpots in small, medium, and large sizes, along with a reliable thermos to keep your beverages just the way you like them.</span><br><br><strong>4 Pcs Gift Pack Glass Top</strong><span>: Perfect for smaller gatherings, this set features a cooler and hotpots in small, medium, and large sizes - everything you need to keep your dishes piping hot or refreshingly cool.</span><br><br><strong>3 Pcs Set Glass Top</strong><span>: A trio of hotpots in small, medium, and large sizes, ideal for those who desire the convenience of versatile and efficient serving options.</span><br><br><strong>Cooler 14 liter</strong><span>: The 14-liter cooler is designed to keep your beverages icy cold, ensuring you can enjoy refreshing drinks no matter the weather.</span><br><br><strong>Small Hotpot</strong><span>: A compact and stylish hotpot to keep your favorite dishes warm and ready to serve.</span><br><br><strong>Medium Hotpot</strong><span>: An intermediate-sized hotpot, perfect for serving mid-sized meals with flair.</span><br><br><strong>Large Hotpot</strong><span>: The grand hotpot, designed for serving large meals with sophistication and precision.</span></p>', NULL, 'happy-arizona-h7-gray-glass-top-5-pcs-set-happy-house-NbfUh', 0, 0, 0, 9600.00, 11500.00, 1, 1, 1, 10, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:09', '2025-05-20 21:13:09', NULL);
INSERT INTO `products` VALUES (201, 'Happy Line Steel Vol-2 ( 5 Pcs Gift Pack ) HAPPY HOUSE', 'happy-line-steel-vol-2-5-pcs-gift-pack-happy-house', NULL, '<div class=\"rte\">\n<h2><b>Happy Line Gift Pack 5 Pcs</b></h2>\n<ul>\n<li><span>Happy Line 5Pcs giftpack set</span></li>\n<li><span>Top glass handle grip</span></li>\n<li><span>Easy to open and lock by twisting the lock.</span></li>\n<li><span>Unique style and appealing appearance</span></li>\n<li><span>Gift pack sizes : Large Hotpot: 4000 ml, Medium Hotpot: 1500 ml, Small Hotpot: 750 ml, Cooler: 8.5 Ltr, Thermos: 1 ltr.</span></li>\n</ul>\n</div>', NULL, 'happy-line-steel-vol-2-5-pcs-gift-pack-happy-house-4scp2', 0, 0, 0, 8650.00, 9500.00, 1, 1, 1, 10, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:09', '2025-05-20 21:13:09', NULL);
