INSERT INTO `products` VALUES (590, '3Section Hexagon Serving Tray GW-HG 743', '3section-hexagon-serving-tray-gw-hg-743', NULL, '<p>Impress your guests with the modern design of this 3-section hexagon serving tray. Its geometric glass bowls, set on a wooden platter, make it perfect for displaying snacks and treats. With its compact size and easy-to-clean hand wash feature, this serving tray is both functional and stylish.</p>', NULL, '3section-hexagon-serving-tray-gw-hg-743-RzYOa', 0, 0, 0, 6000.00, 6500.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:15', '2025-05-20 21:13:15', NULL);
INSERT INTO `products` VALUES (591, '9Pcs Canister & Spice Set BILLI GW5766', '9pcs-canister-spice-set-billi-gw5766', NULL, '<p>Introducing the Billi 6-Piece Spice Bottle and 3-Canister Set! Save space and easily organize your kitchen with this set, including a convenient wooden stand. With the ability to store more, this set is perfect for any home cook. Keep your ingredients fresh in the well-sealed glass and beautifully crafted brown wood.</p>', NULL, '9pcs-canister-spice-set-billi-gw5766-yXFha', 0, 0, 0, 13000.00, 15000.00, 1, 1, 1, 5, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:15', '2025-05-20 21:13:15', NULL);
INSERT INTO `products` VALUES (592, 'Wooden Banana Hanger, BILLI WA-104', 'wooden-banana-hanger-billi-wa-104', NULL, '<p>Maximize the freshness and longevity of your bananas with the Wooden Banana Hanger from BILLI. Suspended to prevent bruising, this bamboo hanger is a natural and eco-friendly option. Measuring 13.5 x 13.5 x 29cm, it\'s the perfect storage solution for your favorite fruit. Hand wash only.</p>', NULL, 'wooden-banana-hanger-billi-wa-104-AP8gu', 0, 0, 0, 3500.00, 4000.00, 1, 1, 1, 5, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:15', '2025-05-20 21:13:15', NULL);
INSERT INTO `products` VALUES (593, 'Rectangular Serving Plate, Brown, BILLI ACA-RT4', 'rectangular-serving-plate-brown-billi-aca-rt4', NULL, '<p>Elevate your home\'s style with our Brown Rectangular Serving Plate, BILLI ACA-RT4. Its simple yet stylish design complements any home decor. With its easy-to-clean surface, this plate is perfect for serving sauces, snacks, and more. Add flair to your table while keeping it organized. Dimensions: 2x30x21 cm.</p>', NULL, 'rectangular-serving-plate-brown-billi-aca-rt4-DvibO', 0, 0, 0, 3500.00, 4000.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:15', '2025-05-20 21:13:15', NULL);
