INSERT INTO `products` VALUES (595, '81138 – DecoBella T-Shirt Organizer', '81138-decobella-t-shirt-organizer', NULL, '<ul>\n<li>It allows the organization of clothes such as T-Shirts, trousers, shirts, scarves, shawls and blouses.</li>\n<li>It helps in orderly placing of clothes in the closet, drawer and suitcase during travel and to keep them wrinkle-free for a long time.</li>\n<li>Due to the fact that the layers are independent, you can easily get the clothes you will use from among the others without wrinkling them and without disturbing the closet layout.</li>\n<li>Thanks to its practicality, your cabinet or drawer always stays organized.</li>\n<li>Made of durable plastic material.</li>\n<li>100% POLYPROPYLENE<br><br>\n</li>\n</ul>', NULL, '81138-decobella-t-shirt-organizer-x7wBS', 0, 0, 0, 350.00, 400.00, 1, 1, 6, 38, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:15', '2025-05-20 21:13:15', NULL);
INSERT INTO `products` VALUES (596, '81137 – Two-Chamber Cutting Board', '81137-two-chamber-cutting-board', NULL, '<ul>\n<li>It protects counter and/or table top surfaces in your kitchens and provides ease of use.</li>\n<li>While doing the cutting process in a much more practical way, you can easily pour the material you prepared on the cutting board into the collection or strainer chamber.</li>\n<li>Both surfaces of the breakout board can be used.</li>\n<li>You can simply remove the breakout board from the hopper and use both compartments of the hopper.</li>\n<li>Easy to clean.</li>\n<li>You can wash it in the dishwasher at a maximum of 70 degrees.</li>\n<li>100% POLYPROPYLENE<br>\n<div class=\"elementor-element elementor-element-568df26 elementor-widget elementor-widget-woocommerce-product-title elementor-page-title elementor-widget-heading\" data-id=\"568df26\" data-element_type=\"widget\" data-widget_type=\"woocommerce-product-title.default\">\n<div class=\"elementor-widget-container\">\n<h1 class=\"product_title entry-title elementor-heading-title elementor-size-default\">81137 – Two-Chamber Cutting Board</h1>\n</div>\n</div>\n<div class=\"elementor-element elementor-element-b185e30 elementor-widget elementor-widget-spacer\" data-id=\"b185e30\" data-element_type=\"widget\" data-widget_type=\"spacer.default\">\n<div class=\"elementor-widget-container\">\n<div class=\"elementor-spacer\">\n<div class=\"elementor-spacer-inner\"><br></div>\n</div>\n</div>\n</div>\n<div class=\"elementor-element elementor-element-341ea5a wc-product-info-yes wc-product-info-top-border-no wc-product-info-bottom-border-no elementor-widget elementor-widget-the7-woocommerce-product-additional-information\" data-id=\"341ea5a\" data-element_type=\"widget\" data-widget_type=\"the7-woocommerce-product-additional-information.default\">\n<div class=\"elementor-widget-container\">\n<table class=\"woocommerce-product-attributes shop_attributes\">\n<tbody>\n<tr class=\"woocommerce-product-attribut