INSERT INTO `products` VALUES (598, '81132 – Breakfast Set', '81132-breakfast-set', NULL, '<ul>\n<li>Thanks to its special design, it is practical and useful.</li>\n<li>It saves space in the refrigerator and collects all breakfast items together.</li>\n<li>Each breakfast plate has small lids that prevent spills and odors.</li>\n<li>Breakfast plates can be stacked on top of each other.</li>\n<li>Thanks to the flat design of the large cover, light items can be placed on it.</li>\n<li>With the slots on the front of the lower chamber where small dishes will be placed, the plates are ensured to stand properly.</li>\n<li>The lower chamber can also be used as a tray with its stylish and comfortable gripping edges.</li>\n<li>Does not contain any harmful substance.</li>\n<li>It is produced from materials suitable for contact with food with the permission of the Ministry of Agriculture.</li>\n<li>It is hygienic and can be washed in the dishwasher.</li>\n<li>It is produced from ABS - GPPS (Polystyrene) - PP Raw Materials.</li>\n</ul>\n<p><span>SET CONTENTS</span></p>\n<ul>\n<li>1 Piece Bottom Hopper (Tray)</li>\n<li>1 Piece Top Cover</li>\n<li>6 Plates</li>\n<li>6 Small Covers<br>\n<table class=\"woocommerce-product-attributes shop_attributes\">\n<tbody>\n<tr class=\"woocommerce-product-attributes-item woocommerce-product-attributes-item--attribute_package-internal-quantity\">\n<th class=\"woocommerce-product-attributes-item__label\">Package Internal Quantity</th>\n<td class=\"woocommerce-product-attributes-item__value\">\n<p>6</p>\n</td>\n</tr>\n<tr class=\"woocommerce-product-attributes-item woocommerce-product-attributes-item--attribute_product-dimension-d-w-h\">\n<th class=\"woocommerce-product-attributes-item__label\">Product Dimension (D / W / H)</th>\n<td class=\"woocommerce-product-attributes-item__value\">\n<p>29x41x6 cm</p>\n</td>\n</tr>\n<tr class=\"woocommerce-product-attributes-item woocommerce-product-attributes-item--attribute_packing-dimension-d-w-h\">\n<th cla