INSERT INTO `products` VALUES (868, '60/80/125ml Sauce Pan Pot Golden Stainless Steel Nonstick Milk Pot With Handle Mini Saucepan For Making Coffee Butter Kitchen Gadgets', '60-80-125ml-sauce-pan-pot-golden-stainless-steel-nonstick-milk-pot-with-handle-mini-saucepan-for-making-coffee-butter-kitchen-gadgets', NULL, '<p>This 60/80/125ml Stainless Steel Sauce Pan Pot is perfect for making coffee, butter, and other delicious treats in your kitchen. The nonstick surface allows for easy cooking and cleaning, while the handle provides a comfortable grip. Made with food grade SS 304, this pot is both durable and safe to use.</p>', NULL, '60-80-125ml-sauce-pan-pot-golden-stainless-steel-nonstick-milk-pot-with-handle-mini-saucepan-for-making-coffee-butter-kitchen-gadgets-z9OsR', 0, 0, 0, 1000.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:19', '2025-05-20 21:13:19', NULL);
INSERT INTO `products` VALUES (869, 'Golden Stainless Steel Serving Plate Restaurant BBQ Skewers Sushi Tray Large Shallow Tray Food', 'golden-stainless-steel-serving-plate-restaurant-bbq-skewers-sushi-tray-large-shallow-tray-food', NULL, '<p>Introducing our Gold Stainless Steel Serving Plate, perfect for restaurant BBQ skewers, sushi trays, and large shallow food trays. Made with durable stainless steel, this versatile plate offers both style and function. Elevate your dining experience with this high-quality serving plate.</p>', NULL, 'golden-stainless-steel-serving-plate-restaurant-bbq-skewers-sushi-tray-large-shallow-tray-food-c2T0Z', 0, 0, 0, 1000.00, NULL, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (870, 'Golden Round Stainless Steel Plate', 'copy-golden-round-stainless-steel-plate', NULL, '<p><span><span>Expertly crafted with durable stainless steel and a food-grade SS 304 coating, the Golden Round Stainless Steel Plate is perfect for all your BBQ needs. Its round design ensures even cooking, providing you with the best results every time. Upgrade your BBQ game with this high-quality, professional plate.</span><span>This Golden Round Stainless Steel Plate is a versatile addition to any kitchen. With a range of sizes from 20cm to 45cm, it is perfect for serving a variety of dishes. Made of food-grade ss304 stainless steel, it ensures durability and safety for all your culinary needs.</span>Add a touch of elegance to your dining experience with our Golden Round Stainless Steel Plate. Available in three sizes - 20cm, 23cm, and 26cm - these plates are perfect for any meal. Crafted with high-quality stainless steel, they are durable and easy to clean. Upgrade your tableware today!</span></p>', NULL, 'copy-golden-round-stainless-steel-plate-e7xCz', 0, 0, 0, 600.00, NULL, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (871, 'Golden Round Stainless Steel Plate', 'golden-round-stainless-steel-plate', NULL, '<p><span>Add a touch of elegance to your dining experience with our Golden Round Stainless Steel Plate. Available in three sizes - 20cm, 23cm, and 26cm - these plates are perfect for any meal. Crafted with high-quality stainless steel, they are durable and easy to clean. Upgrade your tableware today!</span></p>', NULL, 'golden-round-stainless-steel-plate-U2Irh', 0, 0, 0, 900.00, NULL, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (872, 'Golden stainless steel 10*18* Snack Box G', 'golden-stainless-steel-10-18-snack-box-g', NULL, '<p><span>This rectangular service bowl is made of high-quality 304 stainless steel, ensuring it is food grade and safe for storing snacks. Its durable and elegant design is perfect for any occasion, making it a functional and stylish addition to your kitchenware collection. </span></p>', NULL, 'golden-stainless-steel-10-18-snack-box-g-7v9Yy', 0, 0, 0, 1800.00, NULL, 1, 3, NULL, NULL, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (873, 'Korean Style Golden Stainless Steel 304 stainless steel square plate Korean creative fried chicken with ears snack plate French fries basket cooler dish candy snack', 'korean-style-golden-stainless-steel-304-stainless-steel-square-plate-korean-creative-fried-chicken-with-ears-snack-plate-french-fries-basket-cooler-dish-candy-snack', NULL, '<p>Crafted from premium 304 stainless steel, this Korean style square plate is perfect for serving fried chicken, French fries, and other snacks. The unique \"ears\" design adds a touch of creativity to your dining experience. Keep your snacks cooler for longer with the built-in basket. Elevate your next meal with this versatile dish.</p>', NULL, 'korean-style-golden-stainless-steel-304-stainless-steel-square-plate-korean-creative-fried-chicken-with-ears-snack-plate-french-fries-basket-cooler-dish-candy-snack-kxz2p', 0, 0, 0, 1500.00, 1800.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (874, 'Korean Style Golden Stainless Steel Pan With Two Hands', 'korean-style-golden-stainless-steel-pan-with-two-hands-copy', NULL, '<p>Experience the traditional Korean cooking style with our Golden Stainless Steel Pan. Available in 6 different sizes (20, 22, 24, 26, 28, 30cm), this pan features a flat design and two convenient handles for easy handling. Cook and serve your meals in style with this durable and versatile pan.</p>', NULL, 'korean-style-golden-stainless-steel-pan-with-two-hands-copy-nmXFO', 0, 0, 0, 1500.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (875, 'Korean Style Golden Stainless Steel Noodles pan Flat bottomed double ear soup pot cooking pot', 'korean-style-stainless-steel-noodles-pan-flat-bottomed-double-ear-soup-pot-cooking-pot', NULL, '<p>Efficiently serve and cook with the Korean Style Stainless steel Noodles pan. Its 16cm, 20cm, and 22cm deep pot allows for versatility in cooking different meals. Made with durable stainless steel, this flat bottomed pot features double ears for easy handling. Perfect for soups, noodles, and more.</p>', NULL, 'korean-style-stainless-steel-noodles-pan-flat-bottomed-double-ear-soup-pot-cooking-pot-MCHcq', 0, 0, 0, 3000.00, NULL, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (876, 'Korean Style Golden Stainless Steel Pan With Two Hands', 'korean-style-golden-stainless-steel-pan-with-two-hands', NULL, '<p>Crafted from high-quality SS 304 food grade stainless steel, our Golden Serving Frying Pan with two handles is available in six sizes ranging from 18-28 cm. Its unique golden finish adds a touch of elegance to your kitchen while its durability ensures even heat distribution for perfectly cooked dishes every time. Upgrade your cooking game now!</p>', NULL, 'korean-style-golden-stainless-steel-pan-with-two-hands-rgJXF', 0, 0, 0, 1600.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
