INSERT INTO `products` VALUES (878, 'Golden Glass Hammered Design', 'golden-glass-hammered-design', NULL, '<p>Expertly crafted with 304 stainless steel, the Golden Glass Hammered Design offers durability and style. With sizes ranging from 260 to 450ml, this double-layer, food-grade steel product is perfect for any occasion. Enjoy your beverages in a classy and eco-friendly way.</p>', NULL, 'golden-glass-hammered-design-M7jHi', 0, 0, 0, 1400.00, NULL, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (879, 'Prestige Classique Saucepan+Lid', 'prestige-classique-saucepan-lid', NULL, '<p><span>Cook any kind of desi or continental gravy or soup in this awesome saucepan by Prestige\\\'s Classique line, it comes with an easy to cover lid. Its made of high gauge material and is covered with a non-stick layer. Its size is 18 cm. Also it\\\'s dishwasher safe</span></p>', NULL, '20917', 0, 0, 0, 7500.00, 9500.00, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (880, 'Pretige Clasique Milkpn', 'pretige-clasique-milkpn', NULL, '<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\">\n<h3><strong>Product Description</strong></h3>\n<span class=\"a-list-item\"><br>Comfortable Grip Handle: This little milk pan\'s handle is cool to the touch and easy to hold. It is simple to hang it anyplace in the kitchen quickly and save space with its integrated hole in the bottom.</span>\n</li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">Superior Non Stick Surface: Unlike a typical cook pot, this induction base milk pan\'s high performance non stick covering prevents milk from sticking to the bottom or the corners.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">High Quality Aluminium: The Prestige 1.4 litre milk pan is made of high-quality aluminium and is dishwasher safe, making cleanup quick and easy.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">For All Cooktops: Ideal for using with all solid plates, radiant rings, and gas, its flat aluminium induction base transfers heat more quickly and lasts a very long time.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">Scratch Resistance: This milk pan can withstand scratches quite well. In reality, you may stir the milk or other components while they are boiling using any culinary tool, such as a metal spoon.</span></li>\n</ul>', NULL, '14999', 0, 0, 0, 4300.00, 5000.00, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (881, 'Prestige Coffee Pot', 'prestige-coffee-pot', NULL, '<h3><strong>Product Description</strong></h3>\n<p><span>Have a good time preparing hot tea and coffee with Prestige Aluminum Classique Open Coffee Pot, Red. Great for coffee and tea lovers. Nice addition in your kitchen needs. Made of nonstick bottom and the best materials to increase durability and safety for the food commodities. This product features stay-cool handles, which makes cooking very convenient. It has a high heat resistance capacity and heats fast and evenly. Metal ladles can be used in this coffee pot.</span></p>', NULL, '12760', 0, 0, 0, 4600.00, 5500.00, 1, 1, 1, 10, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (882, 'Airtight Glass Jar Set with Wooden Ball Cork Lid, 3 Pack Storage Canisters for Cereal, Pasta, Spices', 'airtight-glass-jar-set-with-wooden-ball-cork-lid-3-pack-storage-canisters-for-cereal-pasta-spices', NULL, '', NULL, 'airtight-glass-jar-set-with-wooden-ball-cork-lid-3-pack-storage-canisters-for-cereal-pasta-spices-0bkVi', 0, 0, 0, 1200.00, 1500.00, 1, 3, NULL, NULL, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (883, 'Glass Oil Bottle with Creative Soy Sauce Vinegar Seasoning Jar Kitchen Condiment Bottle Home Spice Tools', 'glass-oil-bottle-with-creative-soy-sauce-vinegar-seasoning-jar-kitchen-condiment-bottle-home-spice-tools', NULL, '<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">❤ Our seasoning bottle can easily catch the anti-skid catch area. It is as transparent as glass, which can quickly identify the contents, so that you can see it when you need to refill spice.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">■Hand Blown Bearing Quality</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">■Heat-resistant glass</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">■Round cup mouth, large diameter is easier to clean</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">■The cup body is transparent and the scale is clear</span></li>\n</ul>', NULL, 'BG45111', 0, 0, 0, 1500.00, 2000.00, 1, 1, 1, 5, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
