INSERT INTO `products` VALUES (885, 'Glass tea maker electric ceramic oven heating household large capacity kettle health lifting beam teapot', 'glass-tea-maker-electric-ceramic-oven-heating-household-large-capacity-kettle-health-lifting-beam-teapot', NULL, '', NULL, 'RXG-023', 0, 0, 0, 5000.00, 6500.00, 1, 1, 1, 10, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (886, 'Borosilicate Glass Teapot Stovetop Safe Heat Resistant', 'borosilicate-glass-teapot-stovetop-safe-heat-resistant', NULL, '<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">❦ Made with high quality borosilicate glass, strong and sturdy, it can withstand temperature from -20 ~ 160°C. The mesh filter and lid which make from 304 stainless steel are suitable for dishwasher and will never get rusty.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">❦ Glass teapots with lid and an extra-fine hole infuser helps to brew tea in a simple and quick way. Heat-insulated handle. With removable infuser, which made with food grade 304 stainless steel, very safe and easy to clean.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">❦ The appearance of the teapot is designed as a square which not only an appliance but also an Art. Put the amount of loose leaf tea you need into the infuser and pour boiling water through the infuser into the teapot. on-spill Spout. Relax and enjoy.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">❦ Maximum teapot capacity is 18 Ounce / 750 ML, you can make 3 to 5 cups of tea. This pretty small clear teapot is a perfect gift for tea lovers making all kinds of tea and drinks like herbal tea, black tea, flower tea, fruit tea, lemonade, coffee, etc.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">❦ It can be used for Stovetop and dishwasher. We have full confidence that you will love this Glass Teapots, but if you\'re not 100% happy with this cup for any reason,Please feel free to contact with us!</span></li>\n</ul>', NULL, 'BG45080', 0, 0, 0, 1500.00, 2000.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (887, 'Glass Kettle with Lid,50 Ounce Glass Jug-Easy Clean and Heat Resistant Borosilicate Pitcher for Juice,Milk,Cold or Hot Beverages', 'glass-kettle-with-lid-50-ounce-glass-jug-easy-clean-and-heat-resistant-borosilicate-pitcher-for-juice-milk-cold-or-hot-beverages', NULL, '<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">PREMIUM QUALITY:Crafted with high-quality borosilicate glass and stainless steel, this glass kettle ensures durability, heat resistance, and a sleek appearance, making it perfect for serving a variety of cold or hot beverages.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">LARGE CAPACITY:With its generous capacity, this glass pitcher can hold a substantial amount of juice, milk, iced tea, or any other cold or hot beverage, making it ideal for entertaining guests or enjoying a refreshing drink on your own.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">EASY TO CLEAN:The removable lid and wide mouth design allow for easy cleaning and effortless pouring. Simply rinse with water or use a dishwasher for a quick and convenient cleanup.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">VERSATILE USE:Whether you\'re serving iced tea, lemonade, infused water, milk, or hot beverages like coffee or tea, this glass kettle is suitable for all occasions and adds an elegant touch to your table setting.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">SECURE GRIP HANDLE:The ergonomic handle ensures a comfortable and secure grip, allowing for easy pouring without the risk of spills or accidents.</span></li>\n</ul>', NULL, 'Bg45063', 0, 0, 0, 2000.00, 2500.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (888, '4 Pieces Colorful Spice Jar Set', '4-pieces-colorful-spice-jar-set', NULL, '<p>The product is a set of four spice jars with a holder, available in different colors. Key features include:</p>\n<p>Material: Likely made of plastic. </p>\n<p>Design: Each set contains four square-shaped jars with lids and a base holder for organization. </p>\n<p>Function: Designed for storing spices and keeping them fresh. </p>\n<p>Colors: Available in brown, dark gray, and green [the image].</p>\n<p>Size: Dimensions are approximately 35cm in length and 7cm in width [the image].</p>\n<p>Lids: Equipped with shaker lids for easy dispensing. </p>\n<p>Convenience: Keeps spices organized and readily accessible while cooking. </p>', NULL, '4-pieces-colorful-spice-jar-set-Hm2Za', 0, 0, 0, 1299.00, 1500.00, 1, 1, 1, 5, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
