INSERT INTO `products` VALUES (891, 'Luxury *360° Rotating Brush Holder', 'luxury-360-rotating-brush-holder', NULL, '<p>The product shown is a 360° rotating makeup brush holder with a detachable design. Key features include: </p>\n<p>360° Rotation: Allows easy access to all brushes.</p>\n<p>Detachable Compartments: The internal dividers can be removed for cleaning or to accommodate larger items.</p>\n<p>Dustproof Cover: A transparent top cover keeps brushes clean and prevents dust accumulation.</p>\n<p>Organized Storage: Designed with multiple compartments to neatly store various brush sizes.</p>\n<p>Material: Typically made of durable plastic.</p>\n<p>Versatile Use: Suitable for storing makeup brushes, eyeliners, lipsticks, and other cosmetics.</p>', NULL, 'luxury-360-rotating-brush-holder-zjZmk', 0, 0, 0, 1699.00, 1800.00, 1, 9, 26, 39, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (892, '*360° Rotating Brush Holder', '360-rotating-brush-holder', NULL, '<p>The product shown is a 360° rotating makeup brush holder with a detachable design. Key features include: </p>\n<p>360° Rotation: Allows easy access to all brushes.</p>\n<p>Detachable Compartments: The internal dividers can be removed for cleaning or to accommodate larger items.</p>\n<p>Dustproof Cover: A transparent top cover keeps brushes clean and prevents dust accumulation.</p>\n<p>Organized Storage: Designed with multiple compartments to neatly store various brush sizes.</p>\n<p>Compact Size: Measures 24 cm in height and 12 cm in diameter.</p>\n<p>Material: Typically made of durable plastic.</p>\n<p>Versatile Use: Suitable for storing makeup brushes, eyeliners, lipsticks, and other cosmetics.</p>', NULL, '360-rotating-brush-holder-r86ZI', 0, 0, 0, 999.00, 1200.00, 1, 9, 26, 39, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
INSERT INTO `products` VALUES (893, 'Platter, Melamine Appetizer Serving Plate, 5 Sectional Party Snack Relish Tray for Serving Food, Nuts, Candy, Dried Fruit, Veggies BRILLIANT BR00688', 'partition-serving-plate-brilliant-porcelain-br0069', NULL, '<div class=\"product-treasure mb-5\">\n<div class=\"paragraph\">\n<p><em><strong>BRILLIANT</strong></em><br>The 3 Pack Divided Serving Tray has garnered a largely positive reception from customers, highlighting its strength, durability, and versatility. Users appreciate its robust melamine Construction, confidently stating that it is not flimsy like some disposable plastic alternatives. This quality leads many to favor it for repeated use, whether for serving snacks at gatherings or feeding pets. The trays are also commended for their attractive design, easy cleaning capabilities, and perfect sizing for a variety of foods, including vegetables, fruits, and chips. Despite some minor criticisms regarding blemishes and a few instances of cracks upon arrival, the overall sentiment reflects satisfaction with the product’s performance. Many customers express eagerness to explore additional offerings from the brand, indicating an optimistic view of the company’s commitment to quality. The general Consensus is that this tray set is a worthwhile investment for those looking for functional and stylish serving solutions. **</p>\n</div>\n</div>', NULL, 'partition-serving-plate-brilliant-porcelain-br0069-0W38t', 0, 0, 0, 2500.00, 3000.00, 1, 1, 1, 1, 1, 0, 0, 'inactive', 1, 1, '2025-05-20 21:13:20', '2025-05-20 21:13:20', NULL);
