INSERT INTO `products` VALUES (963, 'Square Best Day Jar Mug - 450Ml', 'square-best-day-jar-mug-450ml', NULL, '<p><span>Whether it\'s a nice cold fruit juice in the summer or a hot chocolate in the winter, the Best Day glass jar mug will be perfect for the occasion. The square jar has a 450ml capacity, so there is plenty to quench your thirst. Written on the clear glass, \'Best Day Ever\' in pink gives the mug a stylish look. A long pink and white plastic straw, featuring a lip to stop the straw from falling out when the lid is on, so you can take your time and sip slowly during those hot summer days. A screw top tin lid, with hole for the straw, will help to keep your drink from spilling if accidentally knocked. The glass handle is comfortable to grip, while retaining the country charm feel of the square mug. Easy to clean in warm soapy water, the Good Times square jar mug is ideal for parties or everyday use.</span></p>', NULL, 'LX-004', 0, 0, 0, 800.00, 1834.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
