INSERT INTO `products` VALUES (965, '4 Step+30cm High Eurotower Metal Stepladder', '4-step-eurotower-metal-stepladder-1', NULL, '<h1 class=\"product_title entry-title\">Eurotower Metal Stepladder</h1>\n<div class=\"furgan-product-details__short-description\">\n<p> </p>\n<p>Our new product Eurotower provides ease of use with its high quality structure and wide steps. Eurotower is produced in a factory environment with high quality standards. Robot welding machines are used in the production of the product. Eurotower, which offers safe use with wide steps, unlike ordinary stairs, takes its color with electrostatic paint. The carrying capacity of Eurotower has been determined as 150 kg</p>\n</div>', NULL, '4-step-eurotower-metal-stepladder-1-u93ss', 0, 0, 0, 23000.00, 26000.00, 1, 7, 20, 45, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (966, '7x1 Steps Leo Metal Stepladder', '7x1-steps-leo-metal-stepladder', NULL, '<h1 class=\"product_title entry-title\">Leo Metal Stepladder</h1>\n<div class=\"furgan-product-details__short-description\">\n<p> </p>\n<p>LEO<br>LEO Metal Ladder is a convenient and economical product model obtained as a result of different processes in our giant factory of 12.000 m2. LEO, a model of our Eurostep branded ladder that has taken its place in the world markets and is growing in popularity every day, has a special d profile step, anti-slip foot, wide and non-slip top table, strong attachment apparatus, special oval anti-slip foot. With its oval profile structure, patterned step and foot structure, LEO has a stylish appearance and stands out with its strong step welding. Special d-steps are welded to the side profiles with good quality and two-way. Thanks to the robotic welding machine, the special d steps integrated into the side profiles with a solid and plump welding structure are resistant to the recommended weight of 150 KG. Our LEO model staircase gets its color in the electrostatic painting unit.LEO metal ladder is manufactured by passing through the production chain, such as welding, painting, baking, assembling and packaging. Our Product, 2+1, 3+1, 4+1, 5+1, 6+1, 7+1 it has step options. Metal color for LEO are black. The plastic orange color. The ladder with a step width of C of 6.5 cm for LEO provides ease of use and safety. LEO helps you in your work with its stylish, innovative and high-quality structure</p>\n</div>', NULL, '7x1-steps-leo-metal-stepladder-YQrZW', 0, 0, 0, 20000.00, 25000.00, 1, 7, 20, 45, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
