INSERT INTO `products` VALUES (976, 'Prestige Stainless Steel Frying Pan Skillet With Big Handle 30 cm Fry Pan, Dishwasher Safe, 18/10 (Copy)', 'prestige-stainless-steel-frying-pan-skillet-with-big-handle-28-cm-fry-pan-dishwasher-safe-18-10-copy', NULL, '<p>Experience effortless cooking with the Prestige Stainless Steel Frying Pan. The 30 cm skillet features a sturdy big handle that allows for comfortable handling and control. Made from durable 18/10 stainless steel, this pan is dishwasher safe for easy cleanup. Elevate your cooking game with this high-quality frying pan.</p>', NULL, 'prestige-stainless-steel-frying-pan-skillet-with-big-handle-28-cm-fry-pan-dishwasher-safe-18-10-copy-3y9Hk', 0, 0, 0, 11000.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
