INSERT INTO `products` VALUES (978, 'PRESTIGE ULTRA 28CM KADAI WITH GLASS LID AND PAN HOLDER', 'prestige-ultra-28cm-kadai-with-glass-lid-and-pan-holder', NULL, '<p>Experience premium cooking with the PRESTIGE ULTRA 28CM KADAI. The sturdy glass lid and convenient pan holder make cooking a breeze. Its spacious design allows for versatile cooking options. Upgrade your kitchen with this essential cookware and elevate your culinary skills.</p>', NULL, 'prestige-ultra-28cm-kadai-with-glass-lid-and-pan-holder-cgn6M', 0, 0, 0, 16000.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (979, 'PRESTIGE ULTRA 26CM/6.2L/6.5QT STOCKPOT WITH GLASS LID AND PAN HOLDER', 'prestige-ultra-26cm-6-2l-6-5qt-stockpot-with-glass-lid-and-pan-holder', NULL, '<p>This PRESTIGE ULTRA 26CM/6.2L/6.5QT STOCKPOT is a versatile and durable cooking tool that includes a glass lid and pan holder. With a large 6.2L/6.5QT capacity, it\'s perfect for cooking large meals and the glass lid allows you to monitor your food without removing it. The pan holder provides added convenience and safety while cooking.</p>', NULL, 'prestige-ultra-26cm-6-2l-6-5qt-stockpot-with-glass-lid-and-pan-holder-5oTH5', 0, 0, 0, 16500.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (980, 'PRESTIGE ULTRA 31CM FLAT TAWA WITH PAN HOLDER', 'prestige-ultra-31cm-flat-tawa-with-pan-holder', NULL, '<p>This 31cm flat tawa with pan holder from Prestige Ultra is a must-have for any kitchen. Made with high-quality materials and designed for optimal functionality, it allows for easy cooking and effortless cleaning. Say goodbye to messy stovetops and hello to tasty meals with this versatile tawa.</p>', NULL, 'prestige-ultra-31cm-flat-tawa-with-pan-holder-3ECzP', 0, 0, 0, 11000.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (981, 'PRESTIGE ULTRA 29CM/11.25\" FRYPAN WITH PAN HOLDER', 'prestige-ultra-29cm-11-25-frypan-with-pan-holder', NULL, '<p>The PRESTIGE ULTRA 29CM/11.25\" FRYPAN WITH PAN HOLDER is a versatile and durable addition to any kitchen. With its 29cm diameter and 11.25\" size, it can accommodate large meals and its pan holder makes cooking and serving a breeze. Made with high-quality materials, it provides even heat distribution for perfect results every time.</p>', NULL, 'prestige-ultra-29cm-11-25-frypan-with-pan-holder-v7w8S', 0, 0, 0, 9500.00, NULL, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (982, 'KAMVY Random Design Glass Measuring Drinking Milk Mug with Handle and Clear Lid with Silicone Straw for Girls & Kids Multiple Usage 350 ml', 'kamvy-random-design-glass-measuring-drinking-milk-mug-with-handle-and-clear-lid-with-silicone-straw-for-girls-kids-multiple-usage-350-ml', NULL, '<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">MULTI-USED WITH STRAW AND LID: It’s a heavy Glass cup with two reusable food grade silicone straws. Also comes with a variety &amp; leak proof lid, insert the straw to drink, open the stopper to drink,or just open the lid to drink directly. As a milk cup, water mug , coffee mug , tea cup , juice or any other beverage cup.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">LARGE CAPACITY &amp; ERGONOMICALLY DESIGN: 12OZ /350ml capacity, cup size 3.74 x 2.75 x 4.52 inches, cute printing. Easily measure by the clear scale . Glass tumbler with handle makes it comfortable and convenient to use, applied to both girls boys and adults, airtight seal and leak proof with silicone ring, no worry of spills.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">HEAT AND COLD RESISTANT: Withstand temperature is -20℃ to 150℃, so you can pour boiling water or ice water into this pitcher safely directly.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">EASY TO CLEAN: Wide cup mouth, the diameter of glass cup is 3.74”, suggest hand wash with a brush for durable use.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">NOTE &amp; SATISFACTION GUARANTEED: Clean with warm water first when you received. Glass material is fragile than plastic or stainless steel, so it is inevitable that the package is damaged during the transportation, even with sponge package .If you receive broken one, please contact us without any hesitated. We always stand behind our products,If you are not satisfied for any reason, please do not hesitate to contact us, we will try our best to make you satisfied.</span></li>\n</ul>', NULL, 'ZQ-048', 0, 0, 0, 1500.00, 3000.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
