INSERT INTO `products` VALUES (984, 'Bear Mug Transparent Glass Mug Lid & Glass Straw', 'bear-mug-transparent-glass-mug-lid-glass-straw', NULL, '<h3 class=\"elementor-widget-container\">Bear Mug Transparent Glass Mug Lid &amp; Glass Straw</h3>\n<p><span>Cute Ceramic Mugs / Cups are dominated by beautiful motifs and are equipped with lids and straws. Can be a gift or souvenir for family, lovers, friends or beloved friends.</span></p>', NULL, 'ZQ-045', 0, 0, 0, 1260.00, 1436.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (985, 'Cartoon Glass Straw Cup With Lid Transparent Coffee Juice Cup Party Restaurant Cold Drink Mug 440ml', 'cartoon-glass-straw-cup-with-lid-transparent-coffee-juice-cup-party-restaurant-cold-drink-mug-440ml', NULL, '<div>\n<h1 class=\"seo-sellpoints--title--LyChIKw\">Product sellpoints</h1>\n<ul class=\"seo-sellpoints--sellerPoint--RcmFO_y\">\n<li>\n<pre>Applicable temperature: -20℃-150℃,Designed for versatility, it withstands a wide range of temperatures, perfect for hot or cold drinks.</pre>\n</li>\n<li>\n<pre>Usage: Party and Restaurant,Ideal for parties and restaurants, this cup\'s design makes it a stylish addition to any setting.</pre>\n</li>\n<li>\n<pre>Material: Glass,Crafted from high-quality glass, this cup ensures durability and a clear view of your beverage.</pre>\n</li>\n<li>\n<pre>Capacity: 440ml,Ideal for on-the-go sipping, the 440ml capacity keeps your drinks refreshingly chilled.</pre>\n</li>\n<li>\n<pre>Design: Transparent with Cartoon Straw,Featuring a playful cartoon straw and transparent design, this cup adds a touch of whimsy to your drinkware.</pre>\n</li>\n</ul>\n</div>', NULL, 'ZQ-044', 0, 0, 0, 1800.00, 2200.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (986, 'Glass Barrel Water Dispenser', 'glass-barrel-water-dispenser', NULL, '<div class=\"product__description rte\">\n<p><em><strong>Glass Barrel Water Dispenser</strong></em></p>\n<p>With Wooden Bamboo Stand<br>Bamboo Cork Lid<br>Easy to Fill<br>Non-Leak Tap<br>Easy to Control Flow</p>\n<p><em><strong>Available in 2 Sizes: </strong></em><br>2.5L &amp; 5L</p>\n<p class=\"a-size-large a-spacing-none\"><span class=\"a-size-large product-title-word-break\" id=\"productTitle\">Glassware Drink Dispenser for Juice, Coffee, Tea, Cold Drinks Suitable for Bar Party Daily Use</span></p>\n</div>', NULL, 'Bg45113-5', 0, 0, 0, 9990.00, 10999.00, 1, 1, 1, 5, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (987, 'Borosilicate Cooking Glass Pot with Lid', 'borosilicate-cooking-glass-pot-with-lid', NULL, '<p><strong>Borosilicate Cooking Glass Pot with Lid</strong></p>\n<p>Available in 4 Sizes<br>2.5L, 3.5L, 4.5L &amp; 5.5L</p>\n<p>Transform your kitchen into a culinary haven with Borosilicate Clear Glass Cooking Pot Cookware Set. This exquisite set combines sophistication and practicality, making it an essential addition to any modern kitchen. Crafted from premium borosilicate glass, these pots are engineered to withstand extreme temperatures, providing unmatched durability and longevity. Whether you\'re simmering a delicate sauce, boiling pasta, or preparing a hearty stew, this versatile cookware set ensures consistent and flawless cooking results.</p>\n<ul>\n<li>\n<strong>High-Quality Borosilicate Glass:</strong><span> </span>Resistant to thermal shock and scratches, ensuring long-lasting use.</li>\n<li>\n<strong>Elegant Design:</strong><span> </span>The transparent glass pots allow you to visually monitor your cooking, adding a sleek, contemporary touch to your kitchen.</li>\n<li>\n<strong>Stainless Steel Handles:</strong><span> </span>Ergonomically designed for a secure, comfortable grip, even with heavy dishes.</li>\n<li>\n<strong>Clear Glass Lids:</strong><span> </span>Keep an eye on your food without lifting the lid, preserving heat and moisture.</li>\n<li>\n<strong>Versatile Sizes:</strong><span> </span>The set includes various pot sizes to meet all your cooking needs, from small meals to large family feasts.</li>\n<li>\n<strong>Easy Maintenance:</strong><span> </span>Non-porous glass surface prevents staining and odor absorption, making cleanup</li>\n</ul>', NULL, 'bg45118', 0, 0, 0, 6490.00, 9000.00, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:21', '2025-05-20 21:13:21', NULL);
INSERT INTO `products` VALUES (988, 'Clear Glass Pot for Cooking on Stove,  with Wooden Handle, Boiling Pot', 'clear-glass-pot-for-cooking-on-stove-big-glass-cooking-pot-with-wooden-handle-large-glass-simmer-pot-for-stove-potpourri-glass-frying-pot-with-clear-lid-for-boiling-pot-4-5l', NULL, '<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">Can be directly heated by flame and electric ceramic stove</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">Stainless steel fixed</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">Designed with your safety in mind,the handles of this pot are designed to stay cool to the touch</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">You can easily observe the cooking process without removing the lid, lock the flavor, heat of the food, at a glance, it is easier to grasp the heat.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">It can be used safely for many types of food,soup, milk, and instant noodle etc.</span></li>\n<li class=\"a-spacing-mini\">\n<span class=\"a-list-item\">Use to Marinate, Cook, Bake, Refrigerate Serve</span>\n<p>Cook with ease and safety using our Clear Glass Pot for Cooking on Stove. Designed with a cool-to-touch wooden handle and clear lid for easy monitoring, it\'s perfect for soups, milk, noodles, and more. Made of stainless steel and suitable for direct heating, marinate, cook, bake, refrigerate, and serve all in one pot.</p>\n</li>\n</ul>', NULL, 'bg45116', 0, 0, 0, 8383.00, 11178.00, 1, 1, 1, 13, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:22', '2025-05-20 21:13:22', NULL);
INSERT INTO `products` VALUES (989, 'Glass Mug Square  With Handle, Straw & Wooden Lid 400ml', '400ml-square-glass-mug-with-handle-straw-wooden-lid', NULL, '<ul>\n<li>\n<div><span>400ml Capacity; Customers will get random available handles of cups.</span></div>\n</li>\n<li>\n<div><span>Drinking Glass Clear glass mugs with handle makes more convenient for you to hold cup.</span></div>\n</li>\n<li>\n<div><span>Glass tumbler is suitable for different beverage, coffee, tea, iced tea, milk, juice, etc. Also can be used as water drinking glass cups with lids is convenient to drink.</span></div>\n</li>\n<li>\n<div><span>Suitable gift for birthdays, Valentine\'s Day, Thanksgiving, party gatherings, business gifts, opening ceremonies.</span></div>\n</li>\n<li>\n<div><span>Drinking cup is made high borosilicate glass, with wood lid and glass straw. Reusable and easy to clean.</span></div>\n</li>\n<li>\n<div><span>Drinking glass with 400ml/13.5oz capacity, large enough to hold drinks or coffee for your daily water drinking need.</span></div>\n</li>\n<li>\n<div><span>Portable: The included lids and straws make these cups perfect for on-the-go use, whether you\'re commuting to work or heading out for a picnic.</span></div>\n</li>\n<li>\n<div><span>Versatile: These cups are suitable for a wide range of beverages, including water, juice, smoothies, and more.</span></div>\n</li>\n</ul>', NULL, 'BG45073', 0, 0, 0, 1300.00, 1200.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:22', '2025-05-20 21:13:22', NULL);
INSERT INTO `products` VALUES (990, 'SY4287 Pablo Serving Tray', 'sy4287-pablo-serving-tray', NULL, '', NULL, '11', 0, 0, 0, 4800.00, 5000.00, 1, 13, NULL, NULL, 1, 0, 0, 'inactive', 1, 1, '2025-05-20 21:13:22', '2025-05-20 21:13:22', NULL);
INSERT INTO `products` VALUES (991, 'SY4069 Parition Dry Fruit Tray', 'sy4069-parition-dry-fruit-tray', NULL, '<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Stovetop Safe】Our glass teapot are made of borosilicate lead-free glass, free of any metals and toxins. The glass tea kettle for stovetop can withstand temperatures from -68°F to 302°F, so the glass tea pot can be placed directly on stove top or electric stove. The glass tea kettle with infuser is stovetop-safe, microwave-safe and dishwasher-safe.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Tight Sealing Bamboo Lid】The glass teapot for stovetop comes with a tight silicone reinforced bamboo lid, ensuring it is 100% airtight and leak-proof. So you can enjoy your tea easily without the boiling hot liquid leaking or spilling when you turn the glass tea kettle.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Removable Filter Spout】This glass teapot with infuser has a removable infuser. This infuser is made of 18/8 stainless steel that can filter most teas. You can use this glass tea pot to brew loose leaf tea, tea bags, blooming camellia, fruit tea, herbal tea.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Multiple functions】The glass teapot for stovetop has a capacity of 34 OZ, allowing you to prepare a variety of different beverages, teas, coffees as needed, allowing you to enjoy tea time with family and friends at any social gathering!</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Wonderful Gift Ideal】The glass tea kettle for stovetop comes with beautiful gift boxes which is a perfect gift for family and friends! (such as Mother\'s Day, Father\'s Day, Thanksgiving, Christmas, Thanksgiving).</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Easy to Clean】The glass teapot with infuser features a wide mouth design, which allows you to reach directly into the glass tea kettle and wash it by hand. All parts of the glass tea pot are dishwasher safe, making making tea a breeze. But in order to reduce the collision of the glass teapot in the dishwasher, please try not to wash it in the dishwasher.</span></li>\n</ul>', NULL, '10-1', 0, 0, 0, 4000.00, 4200.00, 1, 1, 1, 1, 1, 0, 0, 'inactive', 1, 1, '2025-05-20 21:13:22', '2025-05-20 21:13:22', NULL);
INSERT INTO `products` VALUES (992, 'Glass Teapot Stovetop', 'glass-teapot-stovetop', NULL, '<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Stovetop Safe】Our glass teapot are made of borosilicate lead-free glass, free of any metals and toxins. The glass tea kettle for stovetop can withstand temperatures from -68°F to 302°F, so the glass tea pot can be placed directly on stove top or electric stove. The glass tea kettle with infuser is stovetop-safe, microwave-safe and dishwasher-safe.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Tight Sealing Bamboo Lid】The glass teapot for stovetop comes with a tight silicone reinforced bamboo lid, ensuring it is 100% airtight and leak-proof. So you can enjoy your tea easily without the boiling hot liquid leaking or spilling when you turn the glass tea kettle.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Removable Filter Spout】This glass teapot with infuser has a removable infuser. This infuser is made of 18/8 stainless steel that can filter most teas. You can use this glass tea pot to brew loose leaf tea, tea bags, blooming camellia, fruit tea, herbal tea.</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Multiple functions】The glass teapot for stovetop has a capacity of 34 OZ, allowing you to prepare a variety of different beverages, teas, coffees as needed, allowing you to enjoy tea time with family and friends at any social gathering!</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Wonderful Gift Ideal】The glass tea kettle for stovetop comes with beautiful gift boxes which is a perfect gift for family and friends! (such as Mother\'s Day, Father\'s Day, Thanksgiving, Christmas, Thanksgiving).</span></li>\n<li class=\"a-spacing-mini\"><span class=\"a-list-item\">【Easy to Clean】The glass teapot with infuser features a wide mouth design, which allows you to reach directly into the glass tea kettle and wash it by hand. All parts of the glass tea pot are dishwasher safe, making making tea a breeze. But in order to reduce the collision of the glass teapot in the dishwasher, please try not to wash it in the dishwasher.</span></li>\n</ul>', NULL, '10-2', 0, 0, 0, 1800.00, 1900.00, 1, 1, 1, 1, 1, 0, 0, 'active', 1, 1, '2025-05-20 21:13:22', '2025-05-20 21:13:22', NULL);
